// interesting, I used a quicksort
// should use a mergesort for cleaner code
#include "leetcode.h"

class SolutionMergeSort {
public:
  ListNode * sortList(ListNode *head) {
    if (head == nullptr || head->next == nullptr) return head;

    ListNode *p = head, *q = head, *r = nullptr;
    while (q != nullptr) {
      q = q->next;
      if (q == nullptr) {
        break;
      }
      r = p;
      q = q->next;
      p = p->next;
    }

    r->next = nullptr;
    ListNode *left = sortList(head);
    ListNode *right = sortList(p);
    return mergeList(left, right);
  }

  ListNode *mergeList(ListNode *a, ListNode *b) {
    if (a == nullptr) return b;
    if (b == nullptr) return a;

    ListNode *head = nullptr, *tail = nullptr;
    while (a != nullptr && b != nullptr) {
      if (a->val <= b->val) {
        if (head == nullptr) {
          head = tail = a;
        } else {
          tail->next = a;
          tail = tail->next;
        }
        a = a->next;
      } else {
        if (head == nullptr) {
          head = tail = b;
        } else {
          tail->next = b;
          tail = tail->next;
        }
        b = b->next;
      }
    }

    // remaining
    if (a != nullptr) {
      tail->next = a;
    } else if (b != nullptr) {
      tail->next = b;
    }
    return head;
  }
};

class SolutionV2 {
public:
  ListNode * sortList(ListNode *head) {
    ListNode *tail = NULL;
    tie(head, tail) = sortListRecursive(head);
    return head;
  }

  pair<ListNode *, ListNode *> sortListRecursive(ListNode *head) {
    if (head == NULL) {
      return make_pair<ListNode *, ListNode *>(NULL, NULL);
    }

    // three lists
    // pivot list
    // < pivot list
    // > pivot list
    ListNode *phead = head, *ptail = head;
    ListNode *p = head->next;
    ListNode *lhead = NULL, *ltail = NULL;
    ListNode *rhead = NULL, *rtail = NULL;

    // partition
    while (p != NULL) {
      // found that it will TLE if I do not chain the nodes that have the 
      // same value as pivot
      if (p->val == phead->val) {
        ptail->next = p;
        ptail = p;
      } else if (p->val < phead->val) {
        if (lhead == NULL) {
          lhead = ltail = p;
        } else {
          ltail->next = p;
          ltail = p;
        }
      } else {
        if (rhead == NULL) {
          rhead = rtail = p;
        } else {
          rtail->next = p;
          rtail = p;
        }
      }
      p = p->next;
    }

    ptail->next = NULL;
    ListNode *newhead = phead, *newtail = ptail;
    if (ltail) {
      ltail->next = NULL;
      tie(lhead, ltail) = sortListRecursive(lhead);
      ltail->next = phead;
      newhead = lhead;
    }
    if (rtail) {
      rtail->next = NULL;
      tie(rhead, rtail) = sortListRecursive(rhead);
      ptail->next = rhead;
      newtail = rtail;
    }

    return make_pair(newhead, newtail);
  }
};

class Solution {
public:
  ListNode *sortList(ListNode *head) {
    ListNode *tail = NULL;
    return sortList(head, tail);
  }

  ListNode *sortList(ListNode *head, ListNode *&tail) {
    if (head == NULL) {
      tail = NULL;
      return NULL;
    }
    if (head->next == NULL) {
      tail = head;
      return head;
    }

    ListNode *L = NULL, *Ltail = NULL, *R = NULL, *Rtail = NULL;
    ListNode *Phead = NULL, *Ptail = NULL;
    tie(Phead, Ptail) = partition(head, L, R);
    ListNode *Lhead = sortList(L, Ltail);
    ListNode *Rhead = sortList(R, Rtail);
    if (Ltail != NULL)
      Ltail->next = Phead;
    Ptail->next = Rhead;
    tail = (Rtail == NULL ? Ptail : Rtail);
    head = (Lhead == NULL ? Phead : Lhead);
    return head;
  }

  pair<ListNode *, ListNode *> partition(ListNode *head, ListNode *&L, ListNode *&R) {
    ListNode *pl = NULL, *pr = NULL, *pp = NULL;
    ListNode *pivot = head;
    head = head->next;
    pivot->next = NULL;
    pp = pivot;
    while(head != NULL) {
      ListNode *next = head->next;
      if (head->val == pivot->val) {
        pp->next = head;
        pp = pp->next;
        pp->next = NULL;
      }
      else if (head->val < pivot->val) {
        if (L == NULL) {
          L = head;
        } else {
          pl->next = head;
        }
        pl = head;
        pl->next = NULL;
      } else {
        if (R == NULL) {
          R = head;
        } else {
          pr->next = head;
        }
        pr = head;
        pr->next = NULL;
      }
      head = next;
    } // while

    return make_pair(pivot, pp);
  }
};

